<!DOCTYPE html>

    <title>IPyWidget export</title>
    <style>
      * { box-sizing: border-box; }

      body {
        background: #333;
        width: 100%;
        padding: 50px;
        margin: 0 auto;
        font-family: Calibri;
        color: white;
      }

      h1 { text-align: center; }

      .widget-subarea { width: 100%; }
      .widget-container { border-radius: 4px; }

        .legend ul {
          background: white;
          color: #333;
          border-radius: 4px;
          margin: 20px 0;
          padding: 10px;
          max-width: 430px;
        }

        li { 
          display: inline;
          position: relative; 
          list-style: none; 
          padding: 0 0 0 20px;
          margin-right: 20px;
        }
        li::before {
          content: "";
          position: absolute;
          left: 0;
          top: 5px;
          width: 10px;
          height: 10px;
          border-radius: 50%
        }

        .blue::before { background-color: blue }
        .green::before { background-color: green }
        .yellow::before { background-color: yellow }
        .orange::before { background-color: orange }
        .red::before { background-color: red }
    </style>
